(function () {
    const api = window.SubwayBuilderAPI;
    const LOG = '[Paris Mod]';

    if (!api) {
        console.error(LOG, 'SubwayBuilderAPI not found!');
        return;
    }

    // translations
    const t = api.utils.i18n.create({
        en: {
            description: 'Redesign the Metropolitan in the City of Light.',
            notification: 'Thank you for downloading my map!\n\nIf the map is blank, make sure you have launched run_windows.bat or run_mac-linux.sh (depending on your OS) from the mod folder. Ensure the terminal window remains open in the background, then restart the game.\n\nTo load the map, press Ctrl + Shift + R (Cmd + Option + R on Mac) while on the main menu.\n\nFeel free to report any bugs in the mod\'s post within the #map-sharing forum on the official Subway Builder Discord.\n\nEnjoy!'
        },
        fr: {
            description: 'Réimaginez le Métropolitain dans la Ville Lumière.',
            notification: 'Merci d\'avoir téléchargé ma carte !\n\nSi rien ne s\'affiche sur la carte, assurez-vous d\'avoir lancé run_windows.bat ou run_mac-linux.sh (selon votre système) dans le dossier du mod. Vérifiez que la fenêtre du terminal reste bien ouverte en arrière-plan, puis redémarrez le jeu.\n\nPour charger la map, utilisez le raccourci Ctrl + Shift + R (Cmd + Option + R sur Mac) depuis le menu principal.\n\nN\'hésitez pas à signaler les bugs sur le post du mod dans le forum #map-sharing du Discord officiel de Subway Builder.\n\nBon jeu !'
        }
    });

    // 1. Register city and tab
    api.registerCity({
        name: 'Paris',
        code: 'PAR',
        description: t('description'),
        population: 4000000,
        initialViewState: {
            zoom: 11.5,
            latitude: 48.8566,
            longitude: 2.3522,
            bearing: 0
        },
        mapImageUrl: 'data:image/png;base64,'
    });

    api.cities.registerTab({
        id: 'france',
        label: '🇫🇷  France',
        cityCodes: ['PAR']
    });

    // 2. Set tile URLs
    api.map.setTileURLOverride({
        cityCode: 'PAR',
        tilesUrl: 'http://127.0.0.1:8080/PAR/{z}/{x}/{y}.mvt',
        foundationTilesUrl: 'http://127.0.0.1:8080/PAR/{z}/{x}/{y}.mvt',
        maxZoom: 15
    });

    // 3. Configure layers
    api.map.setLayerOverride({
        layerId: 'parks-large',
        sourceLayer: 'landuse',
        filter: ['==', ['get', 'kind'], 'park']
    });

    // 4. Set data files
    api.cities.setCityDataFiles('PAR', {
        buildingsIndex: '/data/PAR/buildings_index.json.gz',
        demandData: '/data/PAR/demand_data.json.gz',
        roads: '/data/PAR/roads.geojson.gz',
        runwaysTaxiways: '/data/PAR/runways_taxiways.geojson.gz'
    });

    // 5. Disable missing layers
    api.map.setDefaultLayerVisibility('PAR', {
        buildingFoundations: false,
        oceanFoundations: false
    });

    // in-game notification 
    api.hooks.onCityLoad((cityCode) => {
        if (cityCode === 'PAR') {
            api.ui.showNotification(t('notification'), 'info');
        }
    });

    console.log(LOG, 'Paris mod loaded successfully!');
})();
